import React from "react";
import "./button.css";

function Button({ name, icon, onClick, bg, bPad, color, bRad }) {
  return (
    <button
      style={{
        background: bg,
        padding: bPad,
        borderRadius: bRad,
        color: color,
      }}
      onClick={onClick}
    >
      {icon}
      {name}
    </button>
  );
}

export default Button;
